function calculateDominicanPayroll(t){if("number"!=typeof t)return null;const e={threshold:34685,rate:.15,fixedAmount:0},o={threshold:52027.4167,rate:.2,fixedAmount:2601.33},r={threshold:72260.25,rate:.25,fixedAmount:6648},h=.0304*(t>134820?134820:t),l=.0287*(t>269640?269640:t);let n=0;const s=t-(h+l);if(s>e.threshold&&s<=o.threshold){const t=s-e.threshold;n=e.fixedAmount+t*e.rate}else if(s>o.threshold&&s<=r.threshold){const t=s-o.threshold;n=o.fixedAmount+t*o.rate}else if(s>r.threshold){const t=s-r.threshold;n=r.fixedAmount+t*r.rate}const d=h+l+n;return{monthlySalary:t,netMonthlySalary:t-d,sfs:h,afp:l,isr:n,deductions:d}}